function get_heat_sensor_data(frame_buffer, frame_number)
{
    for(let i=0;i<64;i++){
        frame_buffer[i]=heat_sensor_data[frame_number][i]
    }
    return frame_number; // This is just here to make sure avr-gcc doesn't optimise the call to memcpy_P to be a jmp, because that messes up output processing.// The slowdown because of this hack is less than a few thousand cycles, on a benchmark of 12 million.
}

let ACal=[];
letQCal=[];
letstdCal=[];
letzscore=[];
let z_max, z_min;


// Split into separate function to avoid the compiler just optimising away the whole test.
function heat_calib() {
    let frame_buffer=[];
    for (let i=0; i<100; i++) {
        get_heat_sensor_data(frame_buffer, i);
        fast_calibration(frame_buffer, i);
    }
    get_heat_sensor_data(frame_buffer, 100);
    zscoreCalculation(frame_buffer);
}

function rounding_int_division(dividend, divisor) {
    return (((dividend) + ((divisor) / 2)) / (divisor))
}

function fast_calibration( frame_buffer,  frame_number) {
    for(let i=0; i<64; i++) {
        let  previous_ACal = ACal[i];
        ACal[i] += rounding_int_division(frame_buffer[i] - ACal[i], frame_number+1);
        QCal[i] += (frame_buffer[i] - previous_ACal) * (frame_buffer[i] - ACal[i]);
    }
    for(let  i=0; i<64; i++) {
        stdCal[i] = Math.sqrt(QCal[i]/(frame_number+1));
    }
}


function zscoreCalculation( frame_buffer) {
    let  tempMax = -300000;
    let  tempMin = 300000;

    for(let  i=0; i<64; i++) {
        let  score = 100 * (frame_buffer[i] - ACal[i]) / stdCal[i];

        zscore[i] = score;

        if(score > tempMax) {
            tempMax = score;
        }

        if(score < tempMin) {
            tempMin = score;
        }
    }

    z_max = tempMax;
    z_min = tempMin;
}


function rtcbenchmark_measure_native_performance_heatcalib() {
    console.time("rtc");

    heat_calib();

    console.timeEnd("rtc");
}


const THRESHOLD_LEVEL1   =   2
const THRESHOLD_LEVEL2    =  3
const RED                =   4
const ORANGE             =   3
const YELLOW             =   2
const WHITE              =   1

const ARRAY_SIZE    =   8
const WAITTOCHECK   =  90
const CHECKED       =  91
const NEIGHBOR      =  92
const BOUNDARY      =  99

const LEFT_UP     = 7
const RIGHT_UP    = 63
const LEFT_DOWN   = 0
const RIGHT_DOWN  = 56

let neighbor=[];

let x_weight_coordinate = 0;
let y_weight_coordinate = 0;
let xh_weight_coordinate = 0;
let yh_weight_coordinate = 0;

let yellowGroupH = 0;
let yellowGroupL = 0;
let orangeGroupH = 0;
let orangeGroupL = 0;
let redGroupH = 0;
let redGroupL = 0;

let zscoreWeight=[];

let zscore_threshold_high = 1000;
let zscore_threshold_low = 500;
let zscore_threshold_hot = 5000;
let zscore_threshold_recal = 1000;


function heat_detect( frame_buffer,  color,  rColor,  largestSubset,  testset,  result) {
    zscoreCalculation(frame_buffer);

    let maxSubsetLen = [0];
    get_largest_subset(largestSubset, maxSubsetLen, testset, result);

    reset_log_variable(color);
    if (maxSubsetLen > 1) {
        if (z_max > zscore_threshold_hot) {
            get_filtered_xy(largestSubset, maxSubsetLen);
        } else if (z_max > zscore_threshold_low) {
            get_xy(largestSubset, maxSubsetLen);
            // get_total_heat(largestSubset, maxSubsetLen);
        }
        //rotateXY();
        labelPixel(largestSubset, maxSubsetLen, color);
        rotateColor(color, rColor);
        findGroup(rColor);
    } else {
        printf("panic!\n");
        while(1);
    }

}

function get_largest_subset( largestSubset,  maxSubsetLen,  testset,  result){
    let pixelCount=0;
    for(let i=0; i<64; i++){
        testset[i]=0;
    }
    for(let i=0; i<64; i++){
        if (zscore[i] > zscore_threshold_high) {
            testset[pixelCount]=i;
            pixelCount++;
            zscoreWeight[i]=1;
        } else if (zscore[i] > zscore_threshold_low) {
            if (zscoreWeight[i] || check_neighbor_zscore_weight(i)) {
                testset[pixelCount]=i;
                pixelCount++;
                zscoreWeight[i]=1;
            }
        } else {
            zscoreWeight[i]=0;
        }
    }
    testset[pixelCount] = BOUNDARY;

    find_largestSubset(testset, pixelCount, maxSubsetLen, largestSubset, result);

    // If subset only has one pixel higher than zscore threshold, it will be consideredd as a noise.
    // This subset will be reset here.
    if (maxSubsetLen[0] == 1) {
        maxSubsetLen[0] = 0;
        largestSubset[0] = -1; // reset
    }

}

function find_largestSubset( testset,  testsetLen,  maxSubsetLen,  largestSubset,  result){
    for(let i=0; i<64;i++){result[i]=WAITTOCHECK;}
    let subsetNumber = 0;
    let startIndex = [0];
    while(get_startIndex(testset, testsetLen, result, startIndex)){
        result[testset[startIndex]]=subsetNumber;
        label_subset(testset, testsetLen, result, subsetNumber);
        subsetNumber++;
    }
    select_largest_subset(testset, testsetLen, result, subsetNumber, maxSubsetLen, largestSubset);
}

function select_largest_subset( testset,  testsetLen,  result,  subsetNumber, maxSubsetLen,  largestSubset){
    let maxSubsetNumber = 0;
    for(let i=0; i<subsetNumber; i++){
        let lengthCount = 0;
        for(let j=0; j<testsetLen; j++){
            if(result[testset[j]] == i){
                lengthCount++;
            }
        }
        if(lengthCount > maxSubsetLen[0]){ // if equal, no solution currently
            maxSubsetLen[0] = lengthCount;
            maxSubsetNumber = i;
        }
    }

    // largestSubset = (int32_t*)malloc(sizeof(int32_t)*(*maxSubsetLen));
    let index=0;
    for(let i=0; i<64; i++){
        if(result[i]===maxSubsetNumber){
            largestSubset[index]=i;
            index++;
        }
    }
}


function reset_log_variable( color)
{
    for(let i=0; i<64; i++) {
    color[i] = WHITE;
    }

    x_weight_coordinate = -1;
    y_weight_coordinate = -1;
    xh_weight_coordinate = -1;
    yh_weight_coordinate = -1;

    yellowGroupH = 0;
    yellowGroupL = 0;
    orangeGroupH = 0;
    orangeGroupL = 0;
    redGroupH = 0;
    redGroupL = 0;
}

function get_filtered_xy( largestSubset,  maxSubsetLen) {
    let x_weight_zscore_sum = 0;
    let y_weight_zscore_sum = 0;
    let zscore_sum = 0;
    let low_zscore_length = 0;

    let xh_weight_zscore_sum = 0;
    let yh_weight_zscore_sum = 0;
    let zscore_sum_h = 0;
    let hot_zscore_length = 0;

    for(let i=0; i<maxSubsetLen; i++) {
        let _zscore = zscore[largestSubset[i]];
        if (_zscore > zscore_threshold_hot) {
            zscore_sum_h += _zscore;
            hot_zscore_length += 1;
        } else if (_zscore > zscore_threshold_low) {
            zscore_sum += _zscore;
            low_zscore_length += 1;
        }
    }

    for(let i=0; i<maxSubsetLen; i++) {
        let _x = largestSubset[i] % 8;
        let _y = largestSubset[i] / 8;
        let _zscore = zscore[largestSubset[i]];
        if (_zscore > zscore_threshold_hot) {
            xh_weight_zscore_sum += _x * _zscore / zscore_sum_h;
            yh_weight_zscore_sum += _y * _zscore / zscore_sum_h;
        } else if (_zscore > zscore_threshold_low) {
            x_weight_zscore_sum += _x * _zscore / zscore_sum;
            y_weight_zscore_sum += _y * _zscore / zscore_sum;
        }
    }

    if (hot_zscore_length > 0) {
        xh_weight_coordinate = xh_weight_zscore_sum;
        yh_weight_coordinate = yh_weight_zscore_sum;
    }

    if (low_zscore_length > 0) {
        x_weight_coordinate = x_weight_zscore_sum;
        y_weight_coordinate = y_weight_zscore_sum;
    }
}

function get_xy( largestSubset,  maxSubsetLen) {
    let x_weight_zscore_sum = 0;
    let y_weight_zscore_sum = 0;
    let zscore_sum = 0;

    for(let i=0; i<maxSubsetLen; i++) {
        let _zscore = zscore[largestSubset[i]];
        zscore_sum += _zscore;
    }

    for(let i=0; i<maxSubsetLen; i++) {
        let _x = largestSubset[i] % 8;
        let _y = largestSubset[i] / 8;
        let _zscore = zscore[largestSubset[i]];
        x_weight_zscore_sum += 100 * _x * _zscore / zscore_sum;
        y_weight_zscore_sum += 100 * _y * _zscore / zscore_sum;
    }
    x_weight_coordinate = x_weight_zscore_sum;
    y_weight_coordinate = y_weight_zscore_sum;
}


function labelPixel(largestSubset,  maxSubsetLen,  color)
{
    for(let i=0; i<maxSubsetLen; i++) {
        let pixelIndex = largestSubset[i];
    if (zscore[pixelIndex] > zscore_threshold_hot) {
        color[pixelIndex] = RED;
    } else if (zscore[pixelIndex] > zscore_threshold_high) {
        color[pixelIndex] = ORANGE;
    } else if (zscore[pixelIndex] > zscore_threshold_low) {
        color[pixelIndex] = YELLOW;
    }
}
}

function rotateColor( color, rColor)
{
    // int16_t x_grid = (RIGHT_UP - LEFT_UP) / 7;
    // int16_t y_grid = (LEFT_DOWN - LEFT_UP) / 7;
    for(let i=0; i<8; i++) {
    for (let j=0; j<8; j++) {
        // rColor[i*8+j] = color[LEFT_UP + x_grid*j + y_grid*i];
        rColor[(i<<3)+j] = color[LEFT_UP + (j<<3) - i];
    }
}
}

function findGroup( color)
{
    for(let i=0; i<32; i++){
        let cl = color[i];
    if(cl === YELLOW){
        yellowGroupL |= 1<<i;
    }else if(cl === ORANGE){
        orangeGroupL |= 1<<i;
    }else if(cl === RED){
        redGroupL |= 1<<i;
    }
    cl = color[i+32];
    if(cl === YELLOW){
        yellowGroupH |= 1<<i;
    }else if(cl === ORANGE){
        orangeGroupH |= 1<<i;
    }else if(cl === RED){
        redGroupH |= 1<<i;
    }
}
}

function get_startIndex( testset,  testsetLen,  result, startIndex) {
    for(let i=0; i<testsetLen; i++){
        if(result[testset[i]] === WAITTOCHECK){
            startIndex[0] = i;
            return 1;
        }
    }
    return 0;
}

function label_subset( testset,  testsetLen,  result,  subsetNumber) {
    while(label_neighbor(result, subsetNumber)){
        for(let i=0; i< testsetLen; i++){
            if(result[testset[i]] === NEIGHBOR){
                result[testset[i]]=subsetNumber;
            }
        }
        for(let i=0; i<64; i++){
            if(result[i] === NEIGHBOR){
                result[i]=CHECKED;
            }
        }
    }
}

function get_eight_neighbor( loc,  neighbor) //neighbor length maximum is 8
{
    for (let i=0; i<8; i++) {
        neighbor[i] = -1;
    }
    if((loc / ARRAY_SIZE)===0 && (loc % ARRAY_SIZE)===0){
        neighbor[0]=loc+1; neighbor[1]=loc+ARRAY_SIZE; neighbor[2]=loc+ARRAY_SIZE+1;
    }else if((loc / ARRAY_SIZE)===0 && (loc % ARRAY_SIZE)>0 && (loc % ARRAY_SIZE)<(ARRAY_SIZE-1)){
        neighbor[0]=loc-1; neighbor[1]=loc+1; neighbor[2]=loc+ARRAY_SIZE-1; neighbor[3]=loc+ARRAY_SIZE; neighbor[4]=loc+ARRAY_SIZE+1;
    }else if((loc / ARRAY_SIZE)===0 && (loc % ARRAY_SIZE)===(ARRAY_SIZE-1)){
        neighbor[0]=loc-1; neighbor[1]=loc+ARRAY_SIZE-1; neighbor[2]=loc+ARRAY_SIZE;
    }else if((loc / ARRAY_SIZE)> 0 && (loc / ARRAY_SIZE)<(ARRAY_SIZE-1) && (loc % ARRAY_SIZE)===0){
        neighbor[0]=loc-ARRAY_SIZE; neighbor[1]=loc-ARRAY_SIZE+1; neighbor[2]=loc+1; neighbor[3]=loc+ARRAY_SIZE; neighbor[4]=loc+ARRAY_SIZE+1;
    }else if((loc / ARRAY_SIZE)>0 && (loc / ARRAY_SIZE)<(ARRAY_SIZE-1) && (loc % ARRAY_SIZE)>0 && (loc % ARRAY_SIZE)<(ARRAY_SIZE-1)){
        neighbor[0]=loc-ARRAY_SIZE-1; neighbor[1]=loc-ARRAY_SIZE; neighbor[2]=loc-ARRAY_SIZE+1; neighbor[3]=loc-1; neighbor[4]=loc+1; neighbor[5]=loc+ARRAY_SIZE-1; neighbor[6]=loc+ARRAY_SIZE; neighbor[7]=loc+ARRAY_SIZE+1;
    }else if((loc / ARRAY_SIZE)>0 && (loc / ARRAY_SIZE)<(ARRAY_SIZE-1) && (loc % ARRAY_SIZE)===(ARRAY_SIZE-1)){
        neighbor[0]=loc-ARRAY_SIZE-1; neighbor[1]=loc-ARRAY_SIZE; neighbor[2]=loc-1; neighbor[3]=loc+ARRAY_SIZE-1; neighbor[4]=loc+ARRAY_SIZE;
    }else if((loc / ARRAY_SIZE)===(ARRAY_SIZE-1) && (loc % ARRAY_SIZE)===0){
        neighbor[0]=loc-ARRAY_SIZE; neighbor[1]=loc-ARRAY_SIZE+1; neighbor[2]=loc+1;
    }else if((loc / ARRAY_SIZE)===(ARRAY_SIZE-1) && (loc % ARRAY_SIZE)>0 && (loc % ARRAY_SIZE)<(ARRAY_SIZE-1)){
        neighbor[0]=loc-ARRAY_SIZE-1; neighbor[1]=loc-ARRAY_SIZE; neighbor[2]=loc-ARRAY_SIZE+1; neighbor[3]=loc-1; neighbor[4]=loc+1;
    }else if((loc / ARRAY_SIZE)===(ARRAY_SIZE-1) && (loc % ARRAY_SIZE)===(ARRAY_SIZE-1)){
        neighbor[0]=loc-ARRAY_SIZE-1; neighbor[1]=loc-ARRAY_SIZE; neighbor[2]=loc-1;
    }
}

function get_four_neighbor( loc, neighbor) //neighbor length maximum is 4
{
    for (let i=0; i<4; i++) {
        neighbor[i] = -1;
    }
    if((loc / ARRAY_SIZE)===0 && (loc % ARRAY_SIZE)===0){
        neighbor[0]=loc+1; neighbor[1]=loc+ARRAY_SIZE;
    }else if((loc / ARRAY_SIZE)===0 && (loc % ARRAY_SIZE)>0 && (loc % ARRAY_SIZE)<(ARRAY_SIZE-1)){
        neighbor[0]=loc-1; neighbor[1]=loc+1; neighbor[2]=loc+ARRAY_SIZE;
    }else if((loc / ARRAY_SIZE)===0 && (loc % ARRAY_SIZE)===(ARRAY_SIZE-1)){
        neighbor[0]=loc-1; neighbor[1]=loc+ARRAY_SIZE;
    }else if((loc / ARRAY_SIZE)> 0 && (loc / ARRAY_SIZE)<(ARRAY_SIZE-1) && (loc % ARRAY_SIZE)===0){
        neighbor[0]=loc-ARRAY_SIZE; neighbor[1]=loc+1; neighbor[2]=loc+ARRAY_SIZE;
    }else if((loc / ARRAY_SIZE)>0 && (loc / ARRAY_SIZE)<(ARRAY_SIZE-1) && (loc % ARRAY_SIZE)>0 && (loc % ARRAY_SIZE)<(ARRAY_SIZE-1)){
        neighbor[0]=loc-ARRAY_SIZE; neighbor[1]=loc-1; neighbor[2]=loc+1; neighbor[3]=loc+ARRAY_SIZE;
    }else if((loc / ARRAY_SIZE)>0 && (loc / ARRAY_SIZE)<(ARRAY_SIZE-1) && (loc % ARRAY_SIZE)===(ARRAY_SIZE-1)){
        neighbor[0]=loc-ARRAY_SIZE; neighbor[1]=loc-1; neighbor[2]=loc+ARRAY_SIZE;
    }else if((loc / ARRAY_SIZE)===(ARRAY_SIZE-1) && (loc % ARRAY_SIZE)===0){
        neighbor[0]=loc-ARRAY_SIZE; neighbor[1]=loc+1;
    }else if((loc / ARRAY_SIZE)===(ARRAY_SIZE-1) && (loc % ARRAY_SIZE)>0 && (loc % ARRAY_SIZE)<(ARRAY_SIZE-1)){
        neighbor[0]=loc-ARRAY_SIZE; neighbor[1]=loc-1; neighbor[2]=loc+1;
    }else if((loc / ARRAY_SIZE)===(ARRAY_SIZE-1) && (loc % ARRAY_SIZE)===(ARRAY_SIZE-1)){
        neighbor[0]=loc-ARRAY_SIZE; neighbor[1]=loc-1;
    }
}

function label_neighbor( result,  subsetNumber){
    let hasNeighbor = 0;
    for(let i=0; i<64; i++){
        if(result[i]===subsetNumber){
            get_eight_neighbor(i, neighbor);
            for(let i=0; i<8;i++){
                if(neighbor[i] !== -1 && result[neighbor[i]] === WAITTOCHECK){
                    result[neighbor[i]]=NEIGHBOR;
                    hasNeighbor = 1;
                }
            }
        }
    }
    return hasNeighbor;
}

function check_neighbor_zscore_weight( index) {
    get_four_neighbor(index, neighbor);
    for(let i=0; i<4;i++){
        if (neighbor[i] !== -1) {
            if (zscoreWeight[neighbor[i]]) {
                return 1;
            }
        }
    }
    return 0;
}


